import React from 'react';

const Products = (products) => {
    console.log(products);
    return (
        <div >
            <li> 
            <img style={{height: '300px'}} src={products.imageURL} alt=""/>
                
                {products.name} 
                
                </li>
            
        </div>
    );
};

export default Products;
